import React from 'react';
import Pick from './PickButton'

class DisplayData extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            movie: "Let's see...",
            data: {}
        }
    }

    render() {
        return (
            <div>
                <div>{this.state.movie} {this.state.data.id}</div>
                <Pick />
            </div>
        )
    }
}

export default DisplayData;
